import 'dart:convert';
import 'dart:typed_data';

import 'dart:ui';

import 'package:umbra_flutter/umbra_flutter.dart';

/// {@template star}
/// A Dart Shader class for the `star` shader.
/// {@endtemplate}
class Star extends UmbraShader {
  Star._() : super(_cachedProgram!);

  /// {@macro star}
  static Future<Star> compile() async {
    try {
      // Caching the program on the first compile call.
      _cachedProgram ??= await FragmentProgram.compile(
        spirv: Uint8List.fromList(base64Decode(_spirv)).buffer,
      );

      return Star._();
    } on Exception catch (err, stackTrace) {
      throw UmbraException(err, stackTrace);
    }
  }

  static FragmentProgram? _cachedProgram;

  Shader shader({
    required Size resolution,
    required double iTime,
    required Image iChannel0,
    required Vector3 starColor,
    required Vector3 starGlowColor,
  }) {
    return program.shader(
      floatUniforms: Float32List.fromList([
        iTime,
        starColor.x,
        starColor.y,
        starColor.z,
        starGlowColor.x,
        starGlowColor.y,
        starGlowColor.z,
        resolution.width,
        resolution.height,
      ]),
      samplerUniforms: [
        ImageShader(
          iChannel0,
          TileMode.repeated,
          TileMode.repeated,
          UmbraShader.identity,
        ),
      ],
    );
  }
}

const _spirv =
    '';
